- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of the
    Commission?s letters dated 2/06/2008, covering the 2007 July Monthly Report. Our
    response is as follows:\t  1. The Totals on the Summary and Detailed Summary Pages
    have been amended and now reflect the correct amounts.  2. The memo schedules
    have been re-allocated from Schedule B to their corresponding payment listed on
    Schedule H4.  3. Please be advised that no employee spent more than 25% of his/her
    time on Federal election activity (FEA) or activities in connection with a Federal
    election.  Therefore, the payments listed above as well as any payments for benefits
    were properly paid on the Administrative split on Schedule H4 and not 30B.  4.
    The corresponding H2 schedules now match the H4 fundraising event codes reported.
    \ 5. The account name description H3 May Activity has been changed to FDP Non
    Federal Account  6. Please be advised that no employee spent more than 25% of
    his/her time on Federal election activity (FEA) or activities in connection with
    a Federal election.  Therefore, the payments listed above as well as any payments
    for benefits were properly paid on the Administrative split.  7. The purpose description
    for Printing/Graphics has been further clarified to Admin Printing/Graphics  8.
    The non federal portion of the refund received from BCBS on 6.20.07 was refunded
    to the non federal account on 02.20.08  9. The H4 event ytd totals for Admin are
    now correct.  10. The H4 schedule has been amended to correctly list the allocable
    activity for: Mark Bubriski, Nationwide Interpreter, Union Printing, Tony the
    Pizza Chef, Teresa Cariota, The Westin Diplomat, Anne Morgan, and Rival Sports
    Bar  11. The Time plus payroll payment and itemization have been corrected to
    reflect the same total  12. The missing memos have been re-classed from Schedule
    B to Schedule H4 to correctly support the payments for reimbursements,  13. The
    purpose descriptions for fundraising/consultant, site rental, catering, catering,
    site rental, equipment, equipment rental, event expense on Schedules B and H4
    have been further clarified.  14. The merchant fees now correctly report on Schedule
    B line 21.    Please not that the amount on 11C of the Detailed Summary Page was
    adjusted on this amendment.  The original report contained  an erroneous value
    on 11c that occurred while importing the memo schedules on the original report.
    \ This has now been corrected."
